import React from 'react';
import {DeleteBook, EditBook } from '../../actions/index';
const DataRowItem=({book,onDeleteClick,onEditClick})=>{  
    console.log("DataRowItem Component ",book)
    return (                            
            <tr key={book.id}>
                {/* <td>{this.props.books.length}</td> */}
                <td>{book.booktitle}</td>
                <td>{book.cover}</td>
                <td>{book.author}</td>
                <td>{book.publisher}</td>       
                <td> <button onClick={()=>onEditClick()} className="btn btn-primary">Edit</button>
                     <button onClick={()=>onDeleteClick()} className="btn btn-danger">Delete</button>
                </td>
            </tr>    
    )
}

export default DataRowItem;
